import axios from "axios";

const tenyesztok = "http://localhost:8090/api/tulaj";

class FajtaService {
  getTenyesztok() {
    return axios.get(tenyesztok);
  }

  getTenyesztoById(tenyesztoId) {
    return axios.get(tenyesztok + "/" + tenyesztoId);
  }
  addTenyeszto(tenyeszto) {
    return axios.post(tenyesztok + "/save", tenyeszto);
  }
  updateTenyeszto(tenyeszto) {
    return axios.post(tenyesztok + "/update", tenyeszto);
  }
  deleteTenyeszto(employeeId){
    return axios.delete(EMPLOYEE_API_BASE_URL + '/' + employeeId);
}
}

export default new FajtaService();
